import React from 'react';
import { Routes, Route } from 'react-router-dom';
import './App.css';
import Login from './pages/login/login';

function App() {
  return (
    <div className="App">
      <Routes>
        {/* подстановочный путь */}
        <Route path="/" element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
